INSERT INTO `blog_posts` (`id`, `user_id`, `image_id`, `category_id`, `title`, `alias`, `description`, `html`, `created_at`, `updated_at`) VALUES
(1, 1, 18, 7, 'Utilización de composite en estética dental', 'utilizacin-de-composite-en-esttica-dental', 'Empleo de carillas para aumentar la dimensión vertical.', '<p>Paciente joven que ha llevado ortodoncia durante unos años. Con desgaste dental en los dientes anteriores y falta de oclusión en dientes posteriores por lo que notaba mucha presión delante de la boca. No quiere volver a llevar ortodoncia. Hacemos un aumento de dimensión vertical para mejorar la oclusión y unas carillas en el sector estético. Escaneado digital, diseño cad-cam, fresado overlays de composite para los molares y premolares, carillas hechas a mano de composite. El resultado: recuperamos función y estética. ¡El paciente encantado!</p><figure class=\"image\"><img src=\"/build/img/blog/2022-10-17/evolucion-paciente-carillas-dentales-frente.jpeg\"></figure><figure class=\"image\"><img src=\"/build/img/blog/2022-10-17/evolucion-paciente-carillas-dentales-perfil.jpeg\"></figure>', '2022-10-17 15:15:40', '2022-10-17 15:15:40'),
(2, 1, 19, 17, 'Nuevo escáner intraoral 3Shape TRIOS', 'nuevo-escner-intraoral-3shape-trios', 'En Dentiny apostamos por la última tecnología dental 3D incorporando a nuestras instalaciones el escáner intraoral 3Shape TRIOS', '<figure class=\"image image-style-align-right\"><img src=\"/build/img/blog/2022-10-17/escner-intraoral-3shape-trios.jpg\"></figure><p>Olvídate de las arcadas y las náuseas cuando tu dentista te va a tomar una impresión dental.</p><p>En Dentiny clínica dental en Castellón disponemos de la última tecnología para que esto no vuelva a ocurrir.</p><p>Esta tecnología se llama escáner intraoral 3d, el cual permite obtener y reproducir imágenes en 3D de la totalidad de la estructura bucal. El paciente podrá ver en todo momento el proceso de creación y el diseño de su sonrisa.</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>Diseñar el tratamiento con la máxima precisión.</li><li>Comodidad absoluta para nuestros pacientes.</li><li>Los tiempos de espera para finalizar los tratamientos se reducen más del 50%.</li><li>Tecnología de vanguardia dental.</li></ul><p>&nbsp;</p><figure class=\"image image-style-align-left\"><img src=\"/build/img/blog/2022-10-17/paciente-sonriendo-escaner-3d-dental.png\"></figure><p>Gracias a esta tecnología el paciente puede ver cómo quedará su sonrisa incluso antes de empezar con su tratamiento.</p><p>Todos estos beneficios nos acercan a una calidad de diagnóstico y ejecución dental sublime. Obteniendo unos resultados asombrosos.</p><p>&nbsp;</p><blockquote><p>Apuesta siempre por la última tecnología de vanguardia dental. Quédate en Dentiny.</p></blockquote><p>&nbsp;</p>', '2022-10-17 15:24:54', '2022-10-17 15:30:57'),
(3, 1, 20, 1, 'Microtornillos en ortodoncia', 'microtornillos-en-ortodoncia', 'Los microtornillos son un sistema de anclaje temporal que permite la alineación de los dientes en casos de ortodoncia más complejos', '<p><strong>En ortodoncia uno de los principales retos es el anclaje.</strong> El anclaje en ortodoncia es la estabilidad o la fuerza estable que nos permite mover los dientes hacia donde deseemos.&nbsp;</p><figure class=\"image image-style-align-right\"><img src=\"/build/img/blog/2022-10-20/docotra-claudia-mirando-y-mostrando-una-coleccion-de-microtornillos.jpg\"></figure><p>La mayoría de las veces en los movimientos de ortodoncia ocurren movimientos no deseados que se denomina la pérdida del anclaje, quiere decir que perdemos fuerza en los dientes que están sujetando el movimiento dental produciendo este movimiento indeseado.&nbsp;</p><p>Mover dientes de una o dos raíces es tarea fácil, pero mover molares de tres o cuatro raíces puede ser una tarea prácticamente imposible para el ortodoncista.&nbsp;</p><p>Debido a la necesidad de realizar tratamientos esqueletales en pacientes adultos que no aceptan la cirugía, casos complejos como las mordidas abiertas (clase 2 o clase 3 esqueletales) donde la ultima esperanza del paciente puede ser el uso de microtornillos.&nbsp;</p><p><strong>Los microtornillos nos ofrecen un sistema de anclaje directo</strong>, en ellos podemos colocar aditamentos, gomas y mover los dientes sin producir ningún otro efecto secundario en los dientes adyacentes. También tienen la suficiente estabilidad para aplicar fuerzas a molares pudiendo moverlos hacia adelante o hacia atrás intruyéndolos hacia adentro y de esta forma corregir, por ejemplo, las mordidas abiertas en adultos cambiando totalmente el pronóstico y dando una opción a la cirugía. <strong>Desde que han salido los micro tornillos los límites de la ortodoncia van más allá de los límites biológicos permitidos solamente con brackets o alineadores.&nbsp;</strong></p><figure class=\"image image-style-align-left\"><img src=\"/build/img/blog/2022-10-20/docotra-claudia-sonriendo-y-mostrando-set-de-microtornillos.jpg\"></figure><p>Los microtornillos podemos combinarlos con cualquier tipo de ortodoncia, con alineadores o con “brackets” y nos van a permitir una fuerza extra. En caso de extracciones nos permite cerrar los espacios el doble de rápido de tiempo, sin hacer que se muevan las muelas en movimientos indeseados de los molares. En los casos de clase 2 podemos retruir el maxilar superior y corregir el resalte de forma estable igual que en la case 3 llevando hacia atrás y hacia abajo los molares podemos camuflar problemas esqueléticos en adultos que no quieran realizarse una cirugía.&nbsp;</p><p><strong>Es importante que esto lo realice una persona especializada preferiblemente tu ortodoncista</strong> con formación en micro implantes, para saberlos colocar en el lugar idóneo según su caso. Cada paciente necesitara un estudio minucioso para determinar que tipo de tornillo que longitud y donde se le va a colocar. Cada caso es un reto y evidentemente los microtornillos es un abanico para muchos casos que sin ellos estarían perdidos</p>', '2022-10-20 07:11:24', '2022-10-20 08:28:04');
