INSERT INTO `cases_posts` (`id`, `user_id`, `before_id`, `after_id`, `category_id`, `title`, `alias`, `description`, `html`, `created_at`, `updated_at`) VALUES
(1, 1, 9, 10, 14, 'Rehabilitación de circonio sobre dientes', 'rehabilitacin-de-circonio-sobre-dientes', ' La paciente lleva mucho tiempo queriendo arreglarse la boca. Por el paso del tiempo y el bruxismo que padece ha desgastado mucho sus dientes. ', '<p>Rehabilitación de circonio sobre dientes. La paciente lleva mucho tiempo queriendo arreglarse la boca. Por el paso del tiempo y el bruxismo que padece ha desgastado mucho sus dientes. Nos dijo: \"quiero comer bien y que se vean los dientes al sonreír\" Le hicimos una rehabilitación de circonio para conseguir devolver el tamaño dental y la función masticatoria pérdida.</p>', '2022-10-09 12:00:00', '2022-10-17 13:01:23'),
(2, 1, 3, 4, 11, 'Carillas de composite hechas a mano', 'carillas-de-composite-hechas-a-mano', 'Carillas de composite hechas a mano. Paciente joven al que no le gusta ni la forma ni el color de sus dientes.', '<p>Carillas de composite hechas a mano. Paciente joven al que no le gusta ni la forma ni el color de sus dientes.</p><p>&nbsp;Realizamos carillas de composite directas en la clínica.</p><p>&nbsp;Necesitamos una sesión para hacer el diseño y otra sesión para hacer las carillas.&nbsp;</p><p>En total dos sesiones y sonrisa nueva!</p>', '2022-10-10 12:00:00', '2022-10-17 12:55:45'),
(4, 1, 7, 8, 12, 'Caso rehabilitación superior con Implantes', 'caso-rehabilitacin-superior-con-implantes', 'Paciente joven que acude a la clínica porque se le mueven mucho los dientes superiores y quiere una solución fija. ', '<p>Rehabilitación <strong>superior con implantes.</strong>&nbsp;</p><p>Paciente joven que acude a la clínica porque se le <strong>mueven mucho los dientes superiores </strong>y quiere una<strong> solución fija</strong>.&nbsp;</p><p>Le realizamos extracciones de todos los dientes con movilidad y le pusimos <strong>4 implantes</strong> con una prótesis<strong> ceramo-metálica.</strong>&nbsp;</p><p>El paciente puede <strong>comer perfectamente</strong> y se ve estupendo con su nueva sonrisa.</p>', '2022-10-12 12:00:00', '2022-10-14 17:31:29'),
(5, 1, 1, 2, 11, 'Caso rehabilitación oral con composite', 'caso-rehabilitacin-oral-con-composite', 'Paciente muy joven con mucha sensibilidad al frío y calor. Por problemas médicos había perdido la capa de esmalte que protege los dientes. Recuperamos todo el espesor y la altura perdida del esmalte añadiendo composite a toda la arcada.', '<p>Paciente muy joven con mucha<strong> sensibilidad al frío y calor.</strong></p><p>Por problemas médicos había<strong> perdido la capa de esmalte</strong> que protege los dientes.</p><p>Recuperamos todo el <strong>espesor y la altura </strong>perdida del esmalte <strong>añadiendo composite</strong> a toda la arcada.</p><p><strong>Conseguimos</strong> proteger los dientes con un <strong>tratamiento súper conservador</strong> que le ha quitado la sensibilidad por completo, le permite morder adecuadamente y encima hemos mejorado notablemente la <strong>estética de su sonrisa.</strong></p>', '2022-10-13 12:00:00', '2022-10-14 14:36:18'),
(6, 1, 15, 16, 15, 'Caso limpieza dental manchas clorhexidina', 'caso-limpieza-dental-manchas-clorhexidina', 'Paciente acude a la clínica por unas manchas dentales causadas por un exceso de clorhexidina', '<p>El paciente acude a la clínica para hacerse una limpieza bucodental y para eliminar las manchas dentales.</p>', '2022-10-17 14:17:08', '2022-10-17 14:30:28'),
(7, 1, 21, 22, 12, 'Rehabilitación oral con prótesis completa superior y sobredentadura inferior', 'rehabilitacin-oral-con-prtesis-completa-superior-y-sobredentadura-inferior', 'Rehabilitación oral con prótesis completa superior y sobredentadura inferior', '<p>Rehabilitación oral con prótesis completa superior y sobredentadura inferior</p>', '2022-10-22 05:22:10', '2022-10-22 05:22:10');
INSERT INTO `consents` (`id`, `name`, `description`) VALUES
(1, 'CONSENTIMIENTO INFORMADO PARA LA PROTECCIÓN DE DATOS PERSONALES', 'Protección de datos personales. Los datos de carácter personal que nos faciliten se incluirán en ficheros manuales y/o automatizados cuya titularidad corresponde a DENTINY, S.C. La finalidad de estos ficheros es facilitar la prestación de los servicios sanitarios solicitados y la gestión administrativa de los datos que contienen. En todo momento el interesado podrá ejercer su derecho de acceso, rectificación, cancelación y oposición de sus datos de carácter personal enviando un email a la dirección de policlinica@dentiny.es, o mediante solicitud escrita, fechada y firmada con indicación de su nombre, apellidos, domicilio y fotocopia del DNI dirigida a DENTINY, S.C., responsable del fichero y su tratamiento, con domicilio en C/ Marqués de la Ensenada 42, 12003 Castellón. Los datos personales serán tratados de forma confidencial de acuerdo con lo dispuesto en la ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y garantía de los derechos digitales. Puede consultar la información adicional y detallada sobre Protección de Datos Personales solicitándola al personal de recepción o página web.'),
(2, 'CONSENTIMIENTO INFORMADO PARA EL TRATAMIENTO DE ENDODONCIA', '{intro}\n\nQue se me ha informado sobre la necesidad y conveniencia de realizar un tratamiento de ENDODONCIA en una de mis piezas dentarias. Al respecto, el Doctor {doctor} me ha explicado que:\n\n1. El objetivo principal del tratamiento de endodoncia es el retiro del tejido pulpar inflamado o infectado, sin extraer la pieza dental, y la posterior limpieza, desinfección y relleno de la cámara pulpar y los conductos radiculares con un material que selle la cavidad e impida el paso de bacterias y toxinas.\n\n2. Es factible que exista adicionalmente al proceso infeccioso o inflamatorio, un cuadro granulomatoso o quístico, que requiera la aplicación de otras técnicas terapéuticas.\n\n3. El tratamiento de endodoncia puede requerir la aplicación de anestesia local, la cual se me va a administrar mediante una o varias inyecciones. Se me ha informado que notaré una sensación de acorchamiento del labio, lengua o de otras zonas de la cara, que va a durar entre dos y cuatro horas.\n\n4. A pesar de que se efectúe correctamente la técnica, es factible que la infección o el proceso quístico o granulomatoso no se eliminen totalmente o que no se logre la limpieza, desinfección y relleno óptimo de los conductos radiculares. por lo que puede ser necesario acudir a un retratamiento o a la cirugía periapical al cabo de algunas semanas, meses o incluso años.\n \n5. Es posible que después del tratamiento de endodoncia la pieza dentaria cambie de color y se oscurezca ligeramente o que se debilite y tienda a fracturarse, por lo que puede ser necesario realizarle una corona y/o insertar refuerzos interradiculares (pernos o espigos).\n\n6. Todo acto quirúrgico lleva implícitas una serie de complicaciones comunes y potencialmente serias que podrían requerir tratamientos complementarios tanto médicos como quirúrgicos y que ciertas condiciones médicas (diabetes, cardiopatía, hipertensión, anemia, edad avanzada. obesidad) pueden aumentar estos riesgos y complicaciones. \n\nHe comprendido las explicaciones que se me han facilitado en un lenguaje claro y sencillo, y el facultativo que me ha atendido me ha permitido realizar todas las observaciones y me ha aclarado todas las dudas que le he planteado. También comprendo que, en cualquier momento y sin necesidad de dar ninguna explicación, puedo revocar el consentimiento que ahora presto.\n\nPor ello, manifiesto que estoy satisfecho con la información recibida y que comprendo el alcance y los riesgos del tratamiento, y en tales condiciones CONSIENTO.\n\nEn Castellón a {date}'),
(3, 'CONSENTIMIENTO INFORMADO PARA LA REALIZACIÓN DE EXTRACCIONES DENTALES', '{intro}\r\n\r\nQue el Doctor {doctor} me ha explicado que es conveniente en mi situación realizar la extracción de un diente o muela.\r\n\r\n1. En consecuencia, comprendo que no mantendré ese diente/molar y que, únicamente, podrá ser sustituido por una prótesis. Que podría recurrir a técnicas conservadoras como la periodoncia o la endodoncia, y las descarto por el estado que presenta, y que no hace razonable su conservación.\r\n\r\n2. Me ha explicado que el tratamiento que voy a recibir implica la administración de anestesia local, que consiste en proporcionar, mediante una inyección, sustancias que provocan un bloqueo reversible de los nervios de tal manera que se inhibe transitoriamente la sensibilidad con el fin de realizar el tratamiento sin dolor.\r\n\r\n3. Me ha explicado que tendré la sensación de acorchamiento del labio o de la cara, que normalmente van a desaparecer en dos o tres horas.\r\n\r\n4. La intervención consiste en la aplicación de un fórceps a la corona, practicando la luxación con movimientos de lateralidad, de manera que pueda desprenderse fácilmente del alvéolo donde está insertada.\r\n\r\n5. Aunque se me han realizado los medios diagnósticos que se han estimado precisos, comprendo que es posible que el estado inflamatorio del diente/molar que se me va a extraer pueda producir un proceso infeccioso, que puede requerir tratamiento con antibióticos y/o antiinflamatorios, del mismo modo que en el curso del procedimiento puede producirse una hemorragia, que exigiría, para cohibirla, la colocación en el alvéolo de una torunda de algodón seca u otro producto hemostático incluso sutura. También sé que en el curso del procedimiento pueden producirse, aunque no es frecuente, la rotura de la corona, heridas en la mucosa de la mejilla o en la lengua, inserción de la raíz en el seno maxilar, fractura del maxilar, que no dependen de la forma o modo de practicarse la intervención, ni de su correcta realización, sino que son imprevisibles, en cuyo caso el facultativo tomará las medidas precisas y continuará con la extracción.\r\n\r\n6. El Dentista me ha explicado que todo acto quirúrgico lleva implícitas una serie de complicaciones comunes y potencialmente serias que podrían requerir tratamientos complementarios tanto médicos como quirúrgicos.\r\n\r\nHe comprendido lo que se me ha explicado por el facultativo de forma clara, con un lenguaje sencillo, habiendo resuelto todas las dudas que se me han planteado, y la información complementaria que le he solicitado. Me ha quedado claro que en cualquier momento y sin necesidad de dar ninguna explicación, puedo revocar este consentimiento. Estoy satisfecho con la información recibida y comprendido el alcance y riesgos de este tratamiento, y en por ello, DOY MI CONSENTIMIENDO, para que se me practique el tratamiento de extracción.\r\n\r\nEn Castellón a {date}\r\n'),
(4, 'CONSENTIMIENTO INFORMADO DE ORTODONCIA ', '{intro}\r\n\r\nQue he sido informado/a por el Doctor {doctor} sobre los procedimientos clínicos de ortodoncia, que constan en el plan de tratamiento que previamente he aceptado.\r\n\r\nLos procedimientos propios de la ortodoncia van dirigidos al tratamiento de anomalías en la colocación dentaria o en el desarrollo óseo que pueden producir alteraciones en la función masticatoria y en la estética, principalmente. El propósito principal de la ortodoncia es mejorar la salud bucal al conseguir un alineamiento correcto de los dientes, así como una relación intermaxilar adecuada con una oclusión normal. Los tratamientos de ortodoncia también pueden formar parte de tratamientos más complejos y asociarse a tratamientos periodontales o de prótesis dental. Todos los aparatos, pero en especial los removibles requieren una adecuada colaboración en su uso y cuidados para obtener el resultado previsto. Si el paciente no lo usa el tiempo prescrito, el resultado y la duración no serán los previstos.\r\n\r\nEl/la paciente ha sido informado/a y conoce los riesgos que puede comportar este tratamiento: \r\n\r\n1. Riesgo de sensibilidad dentaria debido a las fuerzas ejercidas sobre los dientes o maxilares.\r\n\r\n2. Riesgo de que se suelten partes de la aparatología fija (brackets, bandas, arcos, etc.) debido a las fuerzas masticatorias. Ante esta situación hay que consultar con el profesional.\r\n\r\n3. Riesgo de ingestión, o incluso aspiración, de los materiales empleados en ortodoncia fija (brackets, etc.) que se hubiesen podido despegar completamente.\r\n\r\n4. Riesgo de pequeñas molestias dolorosas de los dientes y la irritación de encías, labios, mejillas y lengua (llagas). Estas molestias suelen ser iniciales y remiten espontáneamente en unos días.\r\n\r\n5. Riesgo de alergia a los materiales empleados que podría provocar su retirada y un eventual cambio en el plan de tratamiento.\r\n\r\n6. Riesgo de que una deficiente higiene facilite la aparición de manchas blancas permanentes (descalcificaciones), caries dental o gingivitis (encías inflamadas). Se me ha explicado con toda claridad que durante el tratamiento debo de extremar las medidas higiénicas y evitar la ingesta frecuente de productos muy azucarados. Un deficiente control de la placa bacteriana puede obligar incluso a la suspensión del tratamiento.\r\n\r\n6. En caso de tratamientos ortodóncicos con finalidad principalmente estética existirá siempre el riesgo de no cumplir con las expectativas del paciente por motivos difícilmente evitables: imprevisibilidad del crecimiento bucofacial, etc.\r\n\r\n7. Riesgo de que el desarrollo imprevisible de la erupción dentaria, el crecimiento de los maxilares o de respuesta de dientes o hueso a las fuerzas ortodóncicas obliguen a cambiar el plan de tratamiento, requiriendo en ocasiones extracciones de dientes definitivos para conseguir espacio y el alargamiento del tiempo de tratamiento.\r\n\r\n8. Algunos pacientes son más susceptibles a que se produzca la reabsorción (acortamiento) de la raíz de uno o varios dientes sometidos a fuerzas ortodóncicas. Este fenómeno es infrecuente. de etiología desconocida pero imprevisible. Habitualmente esto no tiene consecuencias apreciables, pero en ocasiones puede afectar a la longevidad del diente e implicaría alterar el plan de tratamiento.\r\n\r\n9. Riesgo de molestias o dolor en la articulación témporo-mandibular debido a la modificación del patrón oclusal necesario para el correcto alineamiento dental.\r\n\r\n10- Riesgo de retracciones de la encía. no previsibles, debidas al electo de los movimientos dentarios. También pueden aparecer hipertrofiadas como consecuencia del acumulo de placa bacteriana.\r\n\r\n11. Los dientes incluidos tienen un tratamiento más complejo y sus resultados no se pueden asegurar. Existe la posibilidad que el diente incluido dañe la raíz de los dientes vecinos hasta en ocasiones, provocar su pérdida. En ocasiones el tratamiento falla por anquilosis dental que es imposible diagnosticar previo al tratamiento y que conllevaría la necesidad de extraerlo y reponerlo y estas actuaciones corresponderían a su dentista.\r\n\r\n12. Riesgo de que se produzcan modificaciones en los resultados conseguidos a la conclusión del tratamiento por factores de desarrollo o erupción dentaria, o por modificaciones en el hueso de soporte dental. Estos factores son difícilmente predecibles, pero pueden ser paliados siguiendo las indicaciones dadas por el profesional respecto a la utilización de retenedores y a las revisiones una vez terminado el tratamiento.\r\n\r\nPara prevenir todas estas circunstancias se compromete a someterse a las revisiones periódicas que el profesional considere oportunas durante e incluso después de concluir el tratamiento.\r\n\r\nEl paciente conoce que, después de terminar el tratamiento y dependiendo del caso concreto, es necesario utilizar algún sistema de contención para evitar modificaciones posteriores de la alineación dentaria. Esta fase de retención también precisa revisiones, aunque más espaciadas. Un tratamiento de ortodoncia no garantiza que los dientes estén perfectamente alineados toda la vida, pues a lo largo de los años los dientes están sometidos a fuerzas de masticación, habla, hábitos y al desgaste propio que sufre todo el organismo.\r\n\r\nPor ello, manifiesto que estoy satisfecho con la información recibida y que comprendo el alcance y los riesgos del tratamiento, y en tales condiciones CONSIENTO.\r\n\r\nEn Castellón a {date}\r\n');
